import React from 'react';
import ReactDOM from 'react-dom/client'

const TodoList = () => {

  const items = ['Drink Coffe', 'Build Awesome App']

  return(
  <ul>
    <li>{items[0]}</li>
    <li>{items[1]}</li>
  </ul>
  )
}

const AppHeader = () => {
  return <h1>My ToDo List</h1>
}

const SearchPanel = () => {
  const searchText = 'Type here to search';

  const searchStyle = {
    fontSize: '25px'
  }
  return <input style={searchStyle.fontSize} placeholder={searchText} />}


const App = () => {

  const isLoggedIn = true;
  const loginBox = <span>Log in please</span>
  const welcomeBox = <span>Welcome Back!</span>

  return(
    <div>
      <AppHeader />
      <SearchPanel />
      <TodoList />
    </div>
  )
}

const mainBlock = document.getElementById('root');
const root = ReactDOM.createRoot(mainBlock);
root.render(<App />)
